<script>
    $(document).ready(function(){

     $('#courseTable').DataTable( {
        "order": [[ 5, "asc" ]]
    } );


    //variable for getting the date today
    var dateToday = Date();
    
    //variables for getting the user's fullname
    var firstName = {!! json_encode((array)Auth::user()->profiles->firstName) !!};
    var middleName = {!! json_encode((array)Auth::user()->profiles->middleName) !!};
    var lastName = {!! json_encode((array)Auth::user()->profiles->lastName) !!};
    var fullName = firstName + " " + middleName + " " + lastName;
    

        $('.input-daterange').datepicker({
            todayBtn:'linked',
            format:'yyyy-mm-dd',
            autoclose:true
        });


        function load_data(from_date = '', to_date = '', from_date2 = '', to_date2 = '',fname = '', office = '', course = '',stage = '', status = '',lname = ''){

        $('#applicationTable').DataTable({
            dom: 'Bfrtip',
            buttons: [
                /* --------------------  EXCEL_BUTTON_CODES  -------------------- */
                {   
                    extend: 'excelHtml5',
                    exportOptions: {
                        columns: ':visible'
                        }
                },

                /* --------------------  PDF_BUTTON_CODES  -------------------- */
                {   
                    extend: 'pdfHtml5',
                    title: null,
                    messageTop: 'Generated On: ' + dateToday + '\n' + 'Generated By: ' + fullName,
                    messageBottom: '\nThe information in this table is copyright to UB-ETEEAP.',
                    customize: function ( doc ) {
                        doc.content.splice( 0, 0, {
                            pageMargins: [ 40, 60, 40, 60 ],
                            alignment: 'center',
                            image: 'data:image/jpeg;base64,',
                            
                            width: 550,
                            
                            height: 70
                        } );
                    }
                },

                /* --------------------  column_visibility_button  -------------------- */
                'colvis'
            ],
                orderCellsTop: true,
                fixedHeader: true,
                processing: true,
                serverSide: true,

                ajax: {
                    url:'{{ route("admin.reports.index") }}',
                    data:{from_date:from_date, to_date:to_date,from_date2:from_date2, to_date2:to_date2,fname:fname,office:office , course:course,stage:stage , status:status,lname:lname,}
                    },

                columns: [
                    // {data: 'Index', name: 'Index'},
                    //   {

                    //     data:'appid',
                    //     name:'appid'

                    // },
                    {

                        data:'full_name',
                        name:'full_name'

                    },
                    {
                        data:'office',
                        name:'office'
                    },
                    {
                        data:'courseCode',
                        name:'courseCode'
                    },
                    {
                        data:'stage',
                        name:'stage'
                    },
                    {
                        data:'status',
                        name:'status'
                    },
                   

                    {
                        data:'date',
                        name:'date'
                    },
                      {
                        data:'submitdate',
                        name:'submitdate'
                    },

                    ]

                });
            }

        load_data();


        $('#filter').click(function(){
            var from_date = $('#from_date').val();
            var to_date = $('#to_date').val();
              var from_date2 = $('#from_date2').val();
            var to_date2 = $('#to_date2').val();
            var fname = $('#fname').val();
            var office = $('#office').val();
            var course = $('#course').val();
            var stage = $('#stage').val();
            var status = $('#status').val();
            var lname = $('#lname').val();
          


            if(from_date != '' &&  to_date != '') {
                $('#applicationTable').DataTable().destroy();
                load_data(from_date, to_date, from_date2, to_date2,fname,office,course,stage,status,lname,);
                }
            if(from_date2 != '' &&  to_date2 == '') {
               alert('Both Date is required in Date Submitted');
                }
           if(from_date == '' ||  to_date == '') {

                alert('Both Update Date is required');
                }
            });

        $('#refresh').click(function(){
            $('#from_date').val('');
            $('#to_date').val('');
            $('#from_date2').val('');
            $('#to_date2').val('');
            $('#fname').val('');
            $('#office').val('');
            $('#course').val('');
            $('#stage').val('');
            $('#status').val('');
            $('#lname').val('');
           

            $('#applicationTable').DataTable().destroy();
            load_data();
            });

    });
</script>


